Keeping up with several big projects and and trying to keep my training up for Ninja has not been easy. Fact is, nobody cares and it doesn’t matter. Making the most of the opportunities and doing hard things keep the needle moving forward. Thankful for my @trumomentum crew that keeps me pushing to be better than I was yesterday. Feeling locked in and ready for ANW.

This precision line was a tough one and beat us down pretty good but we all left with some victories. Don’t know whether to call this the Precision Parkway or Humble Highway. 

