Season 11 Oklahoma City Finals (2019)

I’ll be heading out to compete in the next few days for Season 15 and I figured it would be good to post some special moments on my ANW journey to get my head in the right space. This run was a big confidence boost as I hadn’t finished a City Finals course 🚨 since Season 6. Ended up with the 3rd fastest time of the night and gained a ton of momentum heading to National Finals. What’s even cooler is that one of the students on my sideline here (@lol__its_lukevanzeeland) will be competing WITH me this season! Can’t wait! 

