Season 15 Qualifying (2023)

It felt amazing to be back on the course and it was so special having so many of my friends, students, and family present to share this experience with me. Special thanks to all of the amazing people that make this show what it is from the amazing producers, the ATS Team, the rockstar hosts, and everyone in between. Too many to name but you know who you are. Thanks for all of the messages and comments, it means a lot. 🙏🏽 Now it’s time for the Semi Finals! 

@ninjawarrior 
@trumomentum 

#AmericanNinjaWarrior #TeamKarsten #BigKat #TruMomentum #ANW #Dallas #Texas #NinjaWarrior #TruMomentumElite

ANW 15 National Finals: Stage 1

Started off pretty good and got hung up on the “Gambler” obstacle which took me 20 seconds just to get off the last part. On a Stage 1 course, every second counts and this put me behind the pace needed to finish and also gassed me out making the last obstacle extremely difficult. 

In this sport, one mistake can cost you the whole season which only comes once a year. Overall, I’m very happy with my performance this season considering my severe lack of training leading up to it and I fully own and accept the results. I’m extremely thankful for the opportunity to be back on American Ninja Warrior after being away for 2 seasons and it felt amazing to share so many great moments with my students, training partners, and supporters. Congrats to all of those who moved on and especially my man @jonathan_bange who will be taking on Stage 3 next Monday! Good news is that you’ll see the Big Kat on Season 16 but for now I’ll look forward to watching the rest of 15 play out!

@ninjawarrior 
@trumomentum

Lululemon Legacy West Grand Opening

What an amazing experience partnering up with Lululemon Legacy West for their Grand Opening event! The community showed up big and the energy was amazing. It was a special day altogether because we got the opportunity to experience two really big events. Not only did we celebrate the opening of the second largest Lululemon store in the country, but also a celebration of introducing Ninja Project to the community for the very first time! We had people of all ages test themselves in the Grip Challenge on our Promo Rig and raffled off some cool prizes from @hyperice and @kavabar_northdallas! Thank you Lululemon Legacy West for having us out for this awesome event and we appreciate all of the love we received from the community. After this weekend, we couldn’t be more excited for the future! 

